GLSL_SOURCE.acute3DSelectFragPart="#define OUTPUT_INDEX 0\r\n#define OUTPUT_LAYER 1\r\n#define LAYER_NORMAL 1.0\r\n\r\nvec4 acute3DSelectFragPart_intToVec4(int value){\r\n\tvec4 ret = vec4(ivec4(value / 16777216, value / 65536, value / 256, value));\t\r\n\treturn mod(ret, 256.0) / 255.0;\r\n}\r\nint acute3DSelectFragPart_vec4ToInt(vec4 value) {\r\n\t//\u56e0\u70ba\u5149\u67f5\u5316\u5f8c\uff0c\u6d6e\u9ede\u6578\u6703\u88ab\u5167\u63d2\u800c\u6709\u7cbe\u5ea6\u8aa4\u5dee\u3002\r\n\t//\u8aa4\u5dee\u96d6\u7136\u975e\u5e38\u5c0f\uff0c\u4f46\u8db3\u4ee5\u5f71\u97ff\u6574\u6578\u8f49\u578b\u7684\u7d50\u679c\uff0c\u6bd4\u5982\u8aaa10\u6709\u53ef\u80fd\u6703\u8b8a\u6210\u50cf\u662f9.99999998\u7684\u6578\u5b57\uff0c\u5f37\u8f49\u6574\u6578\u5c31\u6703\u8b8a\u62109\u3002\r\n\tvec4 valueFloor = floor(value + vec4(0.5));\r\n\tint ret = int(valueFloor.a);\r\n\tret *= 256;\r\n\tret += int(valueFloor.b);\r\n\tret *= 256;\r\n\tret += int(valueFloor.g);\r\n\tret *= 256;\r\n\tret += int(valueFloor.r);\r\n\treturn ret;\r\n}\r\n\r\nvoid part_main(){\r\n\r\n\tvec4 relColor = partInput.fragColor;\r\n\r\n\tif(param.SelectOutput==OUTPUT_LAYER){\r\n\t\t/**\r\n\t\t* \u8f38\u51fa\u5716\u7d20\u5716\u5c64\u7d22\u5f15 SelectLayer\r\n\t\t* vec4(LayerType,LayerSN(17~24bit),LayerSN(9~16bit),LayerSN(1~8bit))\r\n\t\t*/\r\n\t\trelColor = vec4(LAYER_NORMAL / 255.0, acute3DSelectFragPart_intToVec4(param.LayerSN).yzw);\r\n\t} else {\r\n\t\t/**\r\n\t\t* \u8f38\u51fa\u5716\u7d20\u7684ID SelectIndex\r\n\t\t*/\r\n\t\trelColor = partInput.entityIndexColor;\r\n\t}\r\n\r\n\tpartOutput.fragColor = relColor;\r\n}\r\n";
